import React, { useState } from 'react'
import PropTypes from 'prop-types'

export default function Navbar(prop) {
  const [mode, setMode] = useState('Dark Mode');
  
  const [mystyle,setMystyle]=useState({
    color:'rgb(200, 195, 195)',
    backgroundColor:'rgb(21, 20, 20)'
  })
  const [mystyle2,setMystyle2]=useState({
    color:'rgb(200, 195, 195)'
  })
  
  const onhandlechange=()=>{
    if (mystyle.color==='rgb(200, 195, 195)') {
      //  document.body.style.color='white'
      //   document.body.style.backgroundColor='black'
        setMystyle({
          color:'white',
          backgroundColor:'white'
        })
        setMystyle2({
          color:'white'
        })
        setMode('Light mode')
       
      
    }
  }
  return (
    <nav className="topic"  id="toipc">
      <ul className="topicinside" id="topicinside" style={mystyle}>
        <li className="nametopic"><a href="/" sle>Home</a></li>
        <li className="nametopic"><a href="/">{prop.method} method</a></li>
        <li className="nametopic" id="nametopic3"><a href="/">{prop.title}</a></li>
        <li className="nametopic"><a href="/">{prop.Array}</a></li>
        <li className="nametopic"><a href="/">Help</a></li>
        <li className="nametopic"><button type="button" onClick={onhandlechange} className="btn btn-outline-secondary">{mode}</button></li>
      </ul>
    </nav>
  )
}
Navbar.propTypes = {
  title: PropTypes.string.isRequired,
  method: PropTypes.string.isRequired,
  Array: PropTypes.string.isRequired,

}
Navbar.defaultProps = {
  method: "string method",
  title: "Texutils",
  Array: "Array method",
}
